TLE5:"Goldmet Inn",MEMBERCONSUME_TITLE6:"Bestay",MEMBERCONSUME_DESCRIPTION1:"Jinjiang International Hotel Management Company Limited is the largest star-rated hotel Management Company in China, which manages 116 star hotels with a room inventory of over 37,000 hotel rooms in 75 major cities and resorts all over the nation. Jinjiang's hotel business includes classic hotels, luxury hotels and business hotels. Whether at our top luxury 'J' Hotel, or four or five hotels as our main products, or new brand like Marvel Hotel, you can always find characteristics of local culture and an unforgettable travel experience in Jinjiang hotel.",MEMBERCONSUME_DESCRIPTION2:"The target customers of Metropolo are energetic middle class people who like quiet, elegant, cozy and healthy life, care about spiritual feeling and pursue delicate life experience. Metropolo provides service includes soft and comfortable bedding, safe and reliable washing management, stable bathing facilities, good-quality personal care products, high-speed network, convenient and optional healthy breakfast as well as Chinese-Western dishes and social center which has business function and shows Local cultural characteristics.",MEMBERCONSUME_DESCRIPTION3:"After acquiring French hotels group Louvre, for the first time by way of brand introduction, Jinjiang brings The famous brand of Louvre -- Campanile to China, making it the first youthful middle-class limited-service hotel. Chinese-western restaurant and bar in the hotel provides dishes cooked with the guidance of Michelin-starred chef, ensuring authentic French flavor. The hotel has a total of 158 rooms, can receive business guests, tourists, agreement companies, travel companies and other types of customers. Outstanding employees well-trained by Jinjiang and Campanile together are here to provide you the best service.",MEMBERCONSUME_DESCRIPTION4:"As the first economy hotel brand in China, ever since founded in 1996, Jinjiang Inn is always market-oriented and regards customer demand as core concern. With pragmatic spirit, professionalism and sincere service, we keep perfecting the brand image of Jinjiang Inn. Our brands have gradually become professional model of the economy hotel industry. Jinjiang Inn, Goldmet Inn and Bestay, the network of our brands includes near 1,000 hotels spread over more than 200 big or middle-sized cities in 31 provinces in China. The total number of room is nearly 100,000, making us one of the most influential Chinese economy hotel brand.",MEMBERCONSUME_DESCRIPTION5:"In September 2010,Goldmet Inn joined Jinjiang family and became the brother brand of Jinjiang Inn. We are highly concerned about customers' core demands like sleep, bath, breakfast and internet. Warmness, inclusiveness and innovation are our brand characteristics. Goldmet Inn and Jinjiang Inn have the same quality but different styles. Jinjiang Inn has clear standard, and exterior & interior design has to strictly meet the standard. Goldmet Inn pays more attention to intrinsic quality and has no unified requirement for decoration style.",MEMBERCONSUME_DESCRIPTION6:"Bestay express hotel is the chain hotel managed by Jinjiang Inn Company Limited of Jinjiang International Group. Bestay fully reflects the consumption concept 'more convenient, more efficient and more personalized'.It emphasizes its 'resource-saving' characteristics, and embodies the idea 'Individuality, self-assertion and freedom. Bestay can complete meet ",MEMBERCONSUME_TIP:"Book by direct sales and stay (Direct sales channels includes: official website, Jinjiang trip app, wechat and customer service center)",MEMBERCONSUME_CARD1:"Booking by official website, Jinjiang trip app and wechat gets consumption points and growth points as many as 100% room price. Booking by customer service center gets consumption points and growth points as many as 50% room price. Either way gets 5% discount for room price.",MEMBERCONSUME_CARD2:"Booking by official website, Jinjiang trip app and wechat gets consumption points and growth points as many as 100% room price. Booking by customer service center gets consumption points and growth points as many as 50% room price. Either way gets 10% discount for room price.",MEMBERCONSUME_CARD3:"Booking by official website, Jinjiang trip app and wechat gets consumption points and growth points as many as 120% room price. Booking by customer service center gets consumption points and growth points as many as 60% room price. Either way gets 12% discount for room price.",MEMBERCONSUME_CARD4:"Booking by official website, Jinjiang trip app and wechat gets consumption points and growth points as many as 150% room price. Booking by customer service center gets consumption points and growth points as many as 75% room price. Either way gets 15% discount for room price.",MEMBERCONSUME_BTN:"Book Now",MEMBERWEHOTEL_TITLE:"About WeHotel",MEMBERWEHOTEL_TEXT:"Wehotel is co-founded by famous enterprises: Jinjiang, Lianyin Venture Capital, Hony Capital, Guosheng Investment, etc. We are devoted to building a global hotel sharing platform that creates value for consumers and investors, and achieving a win-win cooperation with hotels and brands, guided by the idea 'member sharing, technology sharing, space sharing and data sharing'. Our membership system is a member sharing platform which has over 100 million members and world-class member service capability. It provides our members benefits, discounts and points of more than 5,000 quality hotels owned by over 20 well-known brands including Jinjiang, Louvre, Plateno and Vienna.",MEMBERBENE_TITLE:"Member benefits",MEMBERBENE_DESCRIPTION:"Consumption in different ways gets different times points",MEMBERBENE_CARD_1:"V1 Classic",MEMBERBENE_CARD_2:"V2 Silver",MEMBERBENE_CARD_3:"V3 Gold",MEMBERBENE_CARD_4:"V4 Platinum",MEMBERBENE_CHANNEL_1:"Official website/App/Wechat/Mini website",MEMBERBENE_CHANNEL_2:"Customer Service Center",MEMBERBENE_CHANNEL_3:"Jinjiang Trip Products",MEMBERBENE_M